script: |
  super -f text -I q4012.spq | sort > q4012.out

inputs:
  - name: q4012.spq
    data: |
      SELECT + col1 FROM tab1 (FORMAT parquet) WHERE - - CAST ( NULL AS INTEGER ) - + ( + col1 ) NOT BETWEEN + 90 AND - 71 * ( - + col1 ) * - col1;
  - name: tab1

outputs:
  - name: q4012.out
    data: |
